import React, { Component } from 'react';

class Header extends Component {
    render() {
        <header className="home-image">
            <div className="header-logo">
                <img src={logo}></img>
            </div>
            <div className="header-words">A Better Way to Blog</div>
        </header>
    }
}

export default Header;
